import classes from "./nav.module.css";
const Nav = () => {

     const logout = () => {
        localStorage.removeItem("profilesAuthToken");
      };

  return (
    <div className={classes.nav}>
      <h1 className={classes.navTitle}>Profiles</h1>
      <button className={classes.logOutButton} onClick={logout}>Log Out</button>
    </div>
  );
};

export default Nav;
